import React, {Component} from 'react';
import PropTypes from 'prop-types';
import {Link} from "react-router-dom";

class ClientNavList extends Component {

    render() {
        return (
            <React.Fragment>
                <li>
                    <Link to='/client'>О сервисе</Link>
                </li>
                <li>
                    <Link to='/client/rooms'>Помещения</Link>
                </li>
                <li>
                    <Link to='/client/contacts'>Контакты</Link>
                </li>
                <li>
                    <Link to='/client/signup'>Регистрация</Link>
                </li>
                <li>
                    <button onClick={() => this.props.openApplicationForm()}>Оформить заявку</button>
                </li>
            </React.Fragment>
        );
    }
}

ClientNavList.propTypes = {
    openApplicationForm: PropTypes.func.isRequired
};

export default ClientNavList;
